import React from "react";

function Menu({ planetNames }) {
  return (
    <div className="menu">
      <ul>
        {planetNames.map((planet, index) => (
          <li className={planet} key={index}>
            {planet}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Menu;
